(def weight-blobs [#uuid "326f602e-f6aa-5917-8ad9-cdab2841052f" #uuid "18acedbe-21f1-52ad-b028-c12300f0472e" #uuid "2af8d76d-1736-5a28-820f-bad460a1324b" #uuid "26ac7e6e-0945-51a1-b5bb-4ec11ac23ef6" #uuid "2e30ed73-249d-5c2e-95c6-e106010c5db0" #uuid "2b94eef0-341d-55e1-8bd9-db2e3dafad70" #uuid "2be287a3-679e-5352-9c42-0c3543da2647" #uuid "26c21252-6e3f-5450-afee-b5e1bf2493b6" #uuid "0c715ead-be57-5387-8702-b775d414de9a" #uuid "1e48e228-5a47-5484-8704-f8290d827f42"])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tiny-xor/weight-blobs</span>","value":"#'tiny-xor/weight-blobs"}
;; <=

;; @@
(def weights (map #(-> (a/get-hdf5-tensor store % "/weight") last) weight-blobs))
