(def bias-blobs [#uuid "29f07016-2d84-5ca3-9809-57412e44ee5c" #uuid "2148c097-d6ae-5bce-a89f-de1db6be0be6" #uuid "1b9df1bc-5d7d-50b3-995e-be504ea0db35" #uuid "187f2cea-e9a4-5a6b-8ec3-f8af00d968e8" #uuid "351953f7-c814-52a1-b321-25ef4366b46c" #uuid "38b238a7-7d8b-59a3-83e4-e3cfa0a33062" #uuid "21987ecc-53ec-509e-8de3-a4e4272b2d63" #uuid "26b5f65e-3a60-5764-9069-dce8322ed26e" #uuid "2a1b4181-c4e0-5784-a180-105f8f2bba5a" #uuid "33211e62-43f8-5ebc-ab35-4ef6d237faad"])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tiny-xor/bias-blobs</span>","value":"#'tiny-xor/bias-blobs"}
;; <=

;; @@
(def biases (map #(-> (a/get-hdf5-tensor store % "/weight") last) bias-blobs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tiny-xor/biases</span>","value":"#'tiny-xor/biases"}
;; <=

;; @@
(def trad-theos 
  (map (fn [w b]
       (let [c (/ (count w) 2)
             vc 2
             trad-rbm (create-theoretical-rbm (partition vc (drop c w)) (take vc b) (drop vc b))]
         (reduce (fn [f s] (update-in f [(take 2 s)] 
                             (fnil + 0)
                             (f/prob (full-matrix (:restricted-weights trad-rbm)) 
                           (concat (:v-biases trad-rbm) (:h-biases trad-rbm)) s)))
        {}
     (f/state-space 8))))
     weights biases))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tiny-xor/trad-theos</span>","value":"#'tiny-xor/trad-theos"}
;; <=

;; @@
(def probs (map #(map % (f/state-space 2)) trad-theos))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tiny-xor/probs</span>","value":"#'tiny-xor/probs"}
;; <=

;; @@
(def mu (map stats/mean (mat/transpose probs)))
